import { TextField,Button } from "@mui/material";
import { setUseProxies } from "immer";
import React,{useState} from "react";
import './Form.css'


function ToDoList()
{
    const [user, setUser] = useState('');
    const [data,setData] = useState([]);


    const handleSubmit =()=>{
    setData ([...data,user]);
    setUser("");


    }

    return(
        <div style={{paddingTop:'90px'}}>

        <div className='body' >
          <TextField name='Firstname' onChange={(e)=>setUser(e.target.value)} sx={{ m: 1, minWidth: 400 }} placeholder='First name' />
        </div>

        <div className='body'>
          <Button onClick={handleSubmit} sx={{ m: 1, minWidth: 400 }}  variant="contained">Submit </Button>
          {data.map((data) => (
            <div>

<List sx={{ width: '100%', maxWidth: 360, bgcolor: 'background.paper' }}>
      <ListItem>
        <ListItemAvatar>
          <Avatar>
            <ImageIcon />
          </Avatar>
        </ListItemAvatar>
        <ListItemText primary="Photos" secondary="Jan 9, 2014" />
      </ListItem>
      <ListItem>
        <ListItemAvatar>
          <Avatar>
            <WorkIcon />
          </Avatar>
        </ListItemAvatar>
        <ListItemText primary="Work" secondary="Jan 7, 2014" />
      </ListItem>
      <ListItem>
        <ListItemAvatar>
          <Avatar>
            <BeachAccessIcon />
          </Avatar>
        </ListItemAvatar>
        <ListItemText primary="Vacation" secondary="July 20, 2014" />
      </ListItem>
    </List>

                </div>
        ))}

        </div>


        </div>
    )
}

export default ToDoList;
